    $Self->{Translation}->{'Selects the change number generator module. With "Date", the change numbers will be generated by the current date and a counter; this format looks like Year.Month.Day.counter, e.g. 2010062400001, 2010062400002. With "DateChecksum", the counter will be appended as checksum to the string of date plus the SystemID. The checksum will be rotated on a daily basis. This format looks like Year.Month.Day.SystemID.Counter.CheckSum, e.g. 2010062410000017, 2010062410000026.'} = 'Seleciona o módulo gerador de números da Alteração. Com a "Data", os números de Alteração serão gerados até a data atual e um contador, este formato é semelhante a do Ano.Mês.Dia.Contador, por exemplo, 2010062400001, 2010062400002. Com a "Soma de verificação da data", o contador será adicionado como soma de verificação para a seqüência de data mais a identificação do sistema. A verificação será rodado com base diária. Este formato é semelhante a Ano.Mês.Dia.Sistema de identificação.Contador.Soma de verificação, por exemplo, 2010062410000017, 2010062410000026.';
    $Self->{Translation}->{'Sets the maximal number of search results for the autocomplete feature.'} = 'Define o número máximo de resultados de pesquisa para o recurso de autocomplete.';
