    $Self->{Translation}->{'This ACL module restricts the usuage of the ticket types that are defined in the sysconfig option \'ITSMChange::AddChangeLinkTicketTypes\', to users of the groups as defined in "ITSMChange::RestrictTicketTypes::Groups".'} = 'Este módulo ACL restringe o uso dos tipos de tickets que são definidos na opção sysconfig \'ITSM Alteração::AdicionarLinkAlterarTipostickets\', para os Utilizadors dos grupos, tal como definido em "Alterar ITSM::Restringir Tipos tickets::Grupos".';
