    $Self->{Translation}->{'Workorder free text options shown in the workorder report of the agent interface. Possible settings: 0 = Disabled, 1 = Enabled, 2 = Enabled and required.'} = 'Opções de texto livre no relatório de ordem de serviço do ecrãn do agente . Configurações possíveis: 0 = inativo, 1 = Ativo, 2 = activo e necessário.';

